var images = ["data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRmWSR-bANXE5sNDP3dyPJrFlCvku1OQ-gyTg&usqp=CAU"];

var dom = document.getElementById("banner");
function extractImg(index) {
    dom.innerHTML = `<img class="images" src="${images[index]}"/>`;
}
var count = 0;
setInterval(function () {
    if (images.length === count) {
        count = 0;
    }
    extractImg(count++)
}, 3000);